import React from 'react';
import Roomfilter from './Room_filter';

export default function Roomslist({room}) {
    if(room.length===0){
        return(
            <div className="empty-search">
                <h3>Unfortunately no rooms mathched your search parameters</h3>
            </div>
        );
    }
    return (
        <section className="roomslist">
            <div className="roomlist-center">
                {
                    room.map(item => {
                        return <Roomfilter key={item.id} room={item} />
                    })
                }
            </div>
        </section>
    );
}
